class Chart{constructor(ctx,config){this.ctx=ctx;this.config=config;this.render()}render(){const c=this.ctx.canvas,d=c.getContext('2d');c.width=c.offsetWidth;c.height=200;d.clearRect(0,0,c.width,c.height);let data=this.config.data.datasets[0].data,labels=this.config.data.labels,max=Math.max(...data),step=max/5;d.beginPath();d.moveTo(50,180);data.forEach((v,i)=>{let x=50+i*(c.width-100)/data.length,y=180-v/max*150;d.lineTo(x,y)});d.strokeStyle=this.config.data.datasets[0].borderColor||'blue';d.stroke();}}
